import React, { useContext } from "react";
import { GlobalContext } from "../context/GlobalState";

export const Feed = () => {
  const { post, getPosts } = useContext(GlobalContext);

  if (post[0]) {
    console.log(typeof post[0].date.getMinutes());
    }
  return (
    <div className="feed">
      {post.map(postObject => {
        return (
          <div key={postObject.id}>
            {postObject.user}
            <br />
            <br />
            {postObject.text}
            <br />
            <br />
            {postObject.date.getHours()}:
            {postObject.date.getMinutes().toString().length < 2
              ? "0" + postObject.date.getMinutes()
              : postObject.date.getMinutes()}{" "}
            - {postObject.date.getDay()}.{postObject.date.getMonth()}.
            {postObject.date.getFullYear()}
            <br />
            <br />
            <hr />
            <br />
          </div>
        );
      })}
    </div>
  );
};
